import React from 'react'
import './Store.css'
import StoreCategories from './StoreCategories';
import Frames from './Frames.js';
import HiveComponents from './HiveComponents';

const products = (i) => {
    switch(i){
        case 'Frames':
            return <Frames/>;
        case 'HiveComponents':
            return <HiveComponents/>;
        // case 'HiveComponents':
        //     return <HiveComponents/>;
        // case 'HiveComponents':
        //     return <HiveComponents/>;
        // case 'HiveComponents':
        //     return <HiveComponents/>;
        default:
            return <Frames/>;
    }
}

function Store( { items } ) {
    return (
        <div className='store'>
            <div className='store__left'>
                <StoreCategories/>
            </div>
            <div className='store__right'>
               {products(items)}
            </div>
        </div>
        
    )
}

export default Store;
